import React from 'react';
import './Node.css'
export default class Node extends React.Component {
  constructor() {
    super({ isFinish, isStart });
    this.state = {
      isFinish,
      isStart
    }
  }
  render() {
    const extraClassName = this.isFinish ? 'node-finish' : this.isStart ? 'node-start' : '';
    return <div className={`node ${extraClassName}`}></div>
  }
}
